'Debugging can be used for troubleshooting. If you turn it on, the system will log every action to your History log. You can use these messages to investigate the flow of commands, and to find out what is wrong. This way you can check what are the scripts doing and where exactly they fail. In production it should be turned off, because it generates multiple history records for each transaction and slows down the system.'=>'Režim ladenia môže byť použitý k riešeniu problémov. Ak ho zapnete, systém zaznamená každú úlohu do zoznamu udalostí. Tieto záznamy môžete použiť na sledovanie vykonaných príkazov a následne tak zistiť prípadné problémy. Týmto spôsobom môžete zistiť, čo presne program robí a kde zlyhal. Z dôvodu produkovania veľkého počtu záznamov a následného spomalenia systému by mal byť v reálnej prevádzke vypnutý.',
'You can automatically send email about payment to the affiliates.<br/>The email is generated using the \'On affiliate payout\' template.'=>'Vaším partnerom môžete automaticky odoslať E-mail o vyplatení. .<br/> E-mail je generovaný s použitím šablóny <strong>Pri vyplatení partnera</strong>.',
