'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Funkcia provízia za úlohu vám umožní definovať províziu úlohu (akciu/operáciu). Týmto spôsobom môžete definovať provízie napríklad za užívateľskú registráciu, za stiahnutie, za navštívenie príslušnej stránky a podobne. <br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
