'Performance rewards is a powerful featuure that allows you to reward your affiliates for their performance.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Výkonnostné pravidlá vám umožňujú odmeňovať partnerov za ich výkon.<br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Všetky kampane v systéme %s sú predvolenom v stave verejné čo znamená, že všetci partneri ich môžu vidieť a propagovať. Táto funkcia vám možní vytvárať súkromné kampane, ktoré sú viditeľné iba vybraným partnerom. <br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Opakujúce sa provízie vám umožňujú odmeňovať vašich partnerov za opakujúce sa platby ako napríklad webhostingove služby či rôzne členstvá. <br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
