'Commission Bonus'=>'Bonusová provízia',
'With this plugin you can add bonus commission to affiliate if action is created with total cost greater than specified value. You can configure Bonus commission in Edit commission type dialog. It is not recommended to activate this plugin at the same time with Split Commission feature.'=>'S použitím tohoto pluginu môžete pridať bonusovú províziu partnerovi v prípade, že celková suma objednávky presiahne definovanú hodnotu. Túto bonusovú províziu môžete nastaviť pre každú kampaň zvlášť a to v záložke nastavenia provízií.',
'Bonus for sales greater than'=>'Bonus pre predaje vyššie ako',
