'Bonus for sales value must be greater than 0 or must equals to -1'=>'Hodnota bonusu musí byť väčšia ako 0  alebo sa musí rovnať - 1
',
'Wrong format used for Bonus commission value'=>'Pre hodnotu bonusovej provízie ste použili nesprávny formát',
'Bonus commission must be greater or equal to 0'=>'Bonusová provízia musí vyť väčšia alebo rovná 0',
'Refid format'=>'Refid formát',
'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Ako ID môžete použiť nasledujúce hodnoty: {9} - bude nahradená akýmkoľvek znakom v rozsahu [0-9],{z} - bude nahradená akýmkoľvek znakom v rozsahu [a-z], {Z} - bude nahradená akýmkoľvek znakom v rozsahu [A-Z]. Všetky ostatné znaky budú skopírované do refid podľa vami zadefinovaného formátu. Príklad dobrého formátu je napríklad: {ZZZ}-{XXXXX}-{999}',
'Refid format saved'=>'Refid formát uložený',
'Refid must be in format "%s". Format definition: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be unchanged. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Refid must be in format "%s". Format definition: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be unchanged. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}',
'Custom refid'=>'Voliteľné ID odkazovateľa (refid)',
'Enables custom refid. You will be able to set refid pattern in configure screen after plugin activation.'=>'Umožní vám zadefinovať voliteľné ID odkazovateľa (refid). Po jeho aktivácií budete môcť nastaviť vzor pre toto pole.',
'Custom field number'=>'Číslo vlastného poľa',
'Custom field number sets number of the custom field which will be used for storing tracking data. '=>'Číslo vlastného poľa nastavuje číslo vlastného poľa, ktoré bude použité k ukladaniu zaznamenaných dát.',
