'Plugin will add to menu Tools new item "Database status", under which you can view database tables of %s. Information about database tables includes e.g. table names, table size, number of rows in each table. You can execute on tables database operations like Analyze table, Optimize table or Repair table. After activation of this plugin you need to reload application in browser to see changes in menu!'=>'Tento plugin vám pridá v menu Nástroje položku <strong>Stav databázy</strong>, v ktorej môžete vidieť databázové tabuľky systému %s. Informácie o databázových tabuľkách zahŕňajú napríklad názov tabuľky, veľkosť tabuľky a počet riadkov v každej tabuľke. Na každej tabuľke môžete vykonať príkaz analyzovať, optimalizovať alebo opraviť. Aby ste videli túto položku v menu, po aktivácií pluginu musíte znovunačítať celú aplikáciu.',
